import React, { Component } from "react"
import axios from "axios"

export default class GoogleAPI extends React.Component{
    constructor(props){
        super(props)
        this.state ={
            places: []
        }
    }

    componentDidMount(){
        axios
            .get('https://maps.googleapis.com/maps/api/place/textsearch/json?query=restaurants+in+Charlottesville&key=AIzaSyBQRbOl8Z5HnrY12zURP84C6Tdwsoy-HUI')
            .then(res =>{
                console.log(res.data.results);
                this.setState({places:res.data.results})

            })
    }
    render(){
        return(
            <div>
                {this.state.places.map(place => <div>{place.results.name}</div>)}
                {this.state.places.map(place => <div>{place.results.price_level}</div>)}
                {this.state.places.map(place => <div>{place.results.rating}</div>)}

            </div>
        )
    }

}
